import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import Header from '../components/Header';
import { motion } from 'framer-motion';
import { useAuth } from '../context/AuthContext';

const LoginPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const [showPassword, setShowPassword] = useState(false);
  const navigate = useNavigate();
  const { login } = useAuth();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);
    try {
      const res = await axios.post('/api/auth/login', { email, password });
      login(res.data.user, res.data.token, res.data.refreshToken);
      navigate('/dashboard');
    } catch (err) {
      setError(err.response?.data?.message || 'Login failed.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <>
      <Header />
      <main id="main-content" className="min-h-screen flex items-center justify-center bg-gray-50" role="main" aria-label="Login main content">
        <section className="w-full max-w-md p-4 sm:p-8 bg-white rounded-2xl shadow-md" aria-labelledby="login-title">
          <h1 id="login-title" className="text-2xl font-semibold text-indigo-600 mb-4">Inkswift Login</h1>
          <form onSubmit={handleSubmit} className="space-y-4" aria-label="Login form">
            <div>
              <label className="block text-sm font-medium text-gray-700" htmlFor="login-email">Email</label>
              <input
                id="login-email"
                type="email"
                className="mt-1 w-full rounded-lg border-gray-300 focus:ring-2 focus:ring-indigo-600 focus:outline-none"
                value={email}
                onChange={e => setEmail(e.target.value)}
                required
                autoFocus
                aria-label="Email address"
                autoComplete="email"
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700" htmlFor="login-password">Password</label>
              <input
                type={showPassword ? 'text' : 'password'}
                className="border rounded px-3 py-2 focus:outline-none focus:ring-2 focus:ring-indigo-400"
                placeholder="Password"
                value={password}
                onChange={e => setPassword(e.target.value)}
                required
                aria-label="Password"
                autoComplete="current-password"
              />
              <button
                type="button"
                className="absolute right-3 top-1/2 transform -translate-y-1/2 text-xs text-gray-500 focus:outline-none focus:ring-2 focus:ring-indigo-400 rounded"
                onClick={() => setShowPassword(v => !v)}
                tabIndex={0}
                aria-label={showPassword ? 'Hide password' : 'Show password'}
              >
                {showPassword ? 'Hide' : 'Show'}
              </button>
            </div>
            {error && <div className="text-rose-500 text-sm" role="alert">{error}</div>}
            <motion.button
              type="submit"
              className="w-full py-2 px-4 bg-indigo-600 text-white rounded-xl font-semibold hover:scale-105 transition-transform focus:outline-none focus:ring-2 focus:ring-indigo-400 disabled:opacity-50"
              disabled={loading}
              aria-label="Login"
              whileHover={{ scale: 1.04 }}
              whileTap={{ scale: 0.97 }}
            >
              {loading ? 'Logging in...' : 'Login'}
            </motion.button>
          </form>
          <div className="mt-4 text-sm text-gray-500 text-center">
            Don&apos;t have an account?{' '}
            <a href="/register" className="text-sky-500 hover:underline focus:outline-none focus:ring-2 focus:ring-sky-400 rounded" aria-label="Go to Register page">Register</a>
          </div>
          <div className="mt-2 text-xs text-center">
            <a href="/forgot-password" className="text-indigo-500 hover:underline focus:outline-none focus:ring-2 focus:ring-indigo-400 rounded" aria-label="Forgot Password">Forgot Password?</a>
          </div>
        </section>
      </main>
    </>
  );
};

export default LoginPage;
